        $value->unsetMetadata();
        $this->assertEquals('obin', $value->getMetadataOrDefault(TenantLoginProviderMetadataVO::from($metadataOtherValue))->value());
        $this->assertNotEquals('bin', $value->getMetadataOrDefault(TenantLoginProviderMetadataVO::from($metadataOtherValue))->value());
        $usersEnabledByDefaultOneValue = true;
        $usersEnabledByDefaultOtherValue = false;
        $copy = $value->usersEnabledByDefault($usersEnabledByDefaultOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(true, $value->isUsersEnabledByDefault());
